sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var mainArr=inputs.variantID;
var riderArr=inputs.req.rider;
//gs.info(mainArr)
var res=[]
var obj={};
// obj={
//     "stringval1":mainArr.mainCover.mainCover,
//     "stringval2":mainArr.mainCover.mainCoverSumAssured,
//     "stringval3":mainArr.mainCover.mainCoverPT,
//     "stringval4":mainArr.mainCover.mainCoverPPT,
// }

obj={
    "stringval1":mainArr,
    "stringval2":inputs.req.sumAssured,
    "stringval3":inputs.req.policyTerm,
    "stringval4":inputs.req.paymentTerm,
}
res.push(obj);
//gs.info("quote:" + JSON.stringify(riderArr))
if(riderArr && riderArr.length>0){
    riderArr.forEach(function(element){
        obj={};
        obj={
        "stringval1":element.name,
        "stringval2":element.sumAssured,
         "stringval3":element.term,
        "stringval4":element.ppt,
        }

        res.push(obj);
    })
}
//gs.info(res);
var resultObject = JSON.parse(inputs.jObj);

var a = {
    "WeoRecStrings150User": res
}
resultObject.pInList1_inout = a;
//gs.info(JSON.stringify(a))

//gs.info(JSON.stringify(resultObject))
outputs.res=resultObject;
})(inputs, outputs);

