sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var req=inputs.req;
var obj=inputs.jObj;
var funds=req.funds;
var arr=[]
funds.forEach(function(element){
arr.push({
    "stringval1":element.name,
    "stringval2":element.value
})
})

var list3={
    "WeoRecStrings150User":arr
}


obj.pInList3_inout=list3;

outputs.res=obj;
})(inputs, outputs);

