sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var req=inputs.req;
if((!req.swpYears|| req.swpYears > JSON.parse(req.pt)-4) && req.variantId  == "VRN003"){
    outputs.flag="Y"
    outputs.years=JSON.parse(req.pt)-4;
}
else{
    outputs.flag=req.swpFlag||""
    outputs.years=req.swpYears||""
}
})(inputs, outputs);

